svg.script:
window.addEventListener('load', () => {
  const urlMap = {
    "中込駅": "https://maps.app.goo.gl/CreaiDWckCravb7r5",
    "県立長野図書館": "https://maps.app.goo.gl/C8AgZETaTWg9FRkC6",
    "SUNAPPLE": "https://maps.app.goo.gl/QTJPji6zdnoehoyb6",
    "シラネバ": "https://maps.app.goo.gl/wTY3CdJArDZDKmRU7",
    "グリーンウッド": "https://maps.app.goo.gl/W9TgK9M22eYTt14V9",
    "フルマチ邸": "https://maps.app.goo.gl/7PnyLcT3DApUjv3K9",
    "Republic": "https://maps.app.goo.gl/odyhVSiW5tY2w6EGA",
    "飯山赤十字病院": "https://maps.app.goo.gl/JppDikbdyywegVYu7",
    "有明高原寮": "https://maps.app.goo.gl/su5aM5g6cBPGBhvJ9"
  };

  document.querySelectorAll('g[data-name]').forEach(g => {
    let name = g.getAttribute('data-name');
    name = name.trim();                // ← スペース除去
    name = name.replace(/\s+/g, "");   // ← 全角・半角空白も除去
    if (urlMap[name]) {
      g.style.cursor = 'pointer';
      g.addEventListener('click', () => window.open(urlMap[name], '_blank'));
    }
  });
});
